import React , { useEffect }from 'react';
import { Switch,Route,Redirect} from "react-router-dom";
import { Router } from 'react-router-dom';
import {SignIn} from "./pages/signIn/signIn.js";
import {SignUp} from "./pages/signUp/signUp.js";
import { HomePage } from './pages/home/home';
import { Profile } from './pages/profile/profile';
import { Setting } from './pages/setting/setting';
import { MessagePage } from './pages/message/message';
import {Search} from './pages/search/search';
import { history } from './helpers/history';
import {SmallMessage} from './components/smallMessage/SmallMessage';
import { PrivateRoute } from './components/PrivateRoute';
import { useDispatch, useSelector } from 'react-redux';
import { PostStatus} from './components/postStatus/PostStatus';
import SimpleMap from './services/gmap';
//alert
import { alertActions } from './actions/alert.actions';

function App() {
    const alert = useSelector(state => state.alert);
    const dispatch = useDispatch();
    useEffect(() => {
        history.listen((location, action) => {
            // clear alert on location change
            dispatch(alertActions.clear());
        });
    }, []);
    return (
        <div className="jumbotron">
            <div className="container">
                <div className="col-sm-8 col-sm-offset-2">
                    {/* {alert &&
                        <div className={`alert ${alert.type}`}>{alert.message}</div>
                    } */}
                    <Router history={history}>
                        <Switch>
                            
                            <PrivateRoute exact path="/" component={HomePage}/>
                            <Route path="/signUp" component={SignUp}/>
                            <Route path="/home" component={HomePage}/>
                            <Route path="/signIn" component={SignIn}/>
                            <Route path="/forgotPassword"/>
                            <Route path="/profile"component={Profile}/>
                            <Route path="/message" component = {MessagePage}/>
                            <Route path="/setting" component = {Setting}/>
                            <Route path="/group"/>
                            <Route path="/smallMessage" component = {SmallMessage}/>
                            <Route path="/store"/>
                            <Route path="/post" component = {PostStatus}/>
                            <Route path="/search" component = {Search}/>
                            <Route path="/gmap" component = {Search}/>
                            <Redirect from="*" to="/" />
                        </Switch>
                    </Router>
                </div>
            </div>
        </div>
    );
}

export {App};
